// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MultiTransfer is Ownable {
    event TransferExecuted(address indexed sender, uint256 totalAmount, uint256 recipientCount);

    constructor() Ownable(msg.sender) {}

    function distributeTokens(
        address tokenAddress, 
        address[] calldata recipients, 
        uint256 totalAmount
    ) external onlyOwner {
        require(recipients.length > 0 && recipients.length <= 10, "Max 10 recipients allowed");
        require(totalAmount > 0, "Transfer amount must be greater than zero");

        IERC20 token = IERC20(tokenAddress);
        uint256 amountPerRecipient = totalAmount / recipients.length;
        uint256 remainder = totalAmount % recipients.length;

        require(token.allowance(msg.sender, address(this)) >= totalAmount, "Contract not approved to spend tokens");
        require(token.transferFrom(msg.sender, address(this), totalAmount), "Transfer from sender failed");

        for (uint256 i = 0; i < recipients.length; i++) {
            uint256 finalAmount = amountPerRecipient + (i == 0 ? remainder : 0);
            require(token.transfer(recipients[i], finalAmount), "Transfer to recipient failed");
        }

        emit TransferExecuted(msg.sender, totalAmount, recipients.length);
    }
}

